INSERT INTO `tss_aboutus` VALUES (1,'<p style=\"text-align: left;\"><strong>What is Track Side Schedule?</strong></p>\n<p style=\"text-align: left;\">TSS is a motorsport event execution and communication platform that aims to increase participant engagement through a digital app experience.</p>\n<p style=\"text-align: left;\">Ease the time pressure -We watched and observed other drivers prepare for their track day, for their run-group&rsquo;s time on track, and how they managed their time in between.</p>\n<p style=\"text-align: left;\">Drivers are setting 4-5 different alarms on their phones as an advanced reminder of their time slot on track. -From having to read and reread the schedule several times looking for their run groups and having to look through everyone else&rsquo;s time slots, it can create pressure, especially when you&rsquo;re trying to anticipate your next time on track.</p>\n<p style=\"text-align: left;\">There&rsquo;s a lot of information to quickly try and filter. Solve the club / participant communication challenge If there&rsquo;s an on-track incident, the schedule of activities can quickly become stale.</p>\n<p style=\"text-align: left;\">You&rsquo;re left to calculate the new schedule in your head. &ldquo;Ok, it is the old schedule +10 mins, because &ldquo;something&rdquo; happened on track. By the way, I couldn&rsquo;t hear the PA system announcement over the track noise.&rdquo;</p>\n<p style=\"text-align: left;\">Other important announcements that are made to the event participants are can also be difficult to hear. We spoke with Drivers about the prospects of an app replacing their paper schedules. Resoundingly, they said &ldquo;yes&ldquo;.</p>\n<p style=\"text-align: left;\">Then next question was &ldquo;when?&rdquo; We knew we were on to something. Digital schedules, reminders, alarms, and notifications are day 1 features, but there&rsquo;s so much more to make the experience better. We have ideas for the next several releases, but the customer should drive the experience.</p>\n<p style=\"text-align: left;\"><strong>That&rsquo;s why we want to hear from you. Drop us a line: here Easy to Follow Web Portal and Native Apps Free for Club Organizations to use for their events Designed by a track enthusiast with an IT background.</strong></p>\n<p style=\"text-align: left;\">Built-in schedule builder for track event activities. Crisp interface &ndash; the app is intuitive, simple, and easy to use. See something that can be improved, tell us!</p>','1','2020-03-03 10:29:15',1);
/*!40000 ALTER TABLE `tss_aboutus` ENABLE KEYS */;
UNLOCK TABLES;

