2 309-3165 Order well in advance to ensure availability.\n\nNo registered vehicle may exceed 102 dbA.\n\n3-day solo DE, lots of track time, DE registration is open now at ClubRegistration.net\n\nFor more information contact:\nRace Chair: Dave Sorenson\ndsorenson@leancultureinc.com 952.807.1414\n\n\nSee NordStern.org www.NordStern.org for more event information as it becomes available.\n\nThe Brainerd/Baxter area is a summertime recreational retreat featuring many activities such as golf, fishing, boating and biking.  There is no central hotel, but most racers stay at the Country Inn, Super 8, or AmericInn in Baxter. All of these are within 5 miles of the track. There are many wonderful places to stay if you are looking for something more than a place to shower and sleep. Great family hotels are the Holiday Inn Express Hotel and Suites, Comfort Suites Rapid River Lodge-both are in Baxter and feature water parks.  For vacationers there are also resorts such as Maddens and Cragun\'s Resort.','Join us for Nord Stern\'s 28th Annual Loonacy Club Race. \n\nBrainerd International Raceway - The fastest track in North America!\n\n3.1 miles, 10 turns, Donnybrooke Road Course\n\n102 dB sound restriction.\n\n* Optional Racer Lapping Friday, under DE rules - Under Lapping Sessions - Racer Lapping for PCA Licensed Club Racers registered for the Loonacy Sprint or Enduro Races OR Click here to register\n\nSaturday 1 Sprint Race\nSunday 1 Sprint Race and 90-minute Enduro\nParade laps on Saturday & Sunday\n\nComplimentary camping available at the track\n24-hour security & access\n\nGate opens Thursday, July 23, at 5 PM. Big rigs on hand enter the paddock first.\n\nThe 3 points races at this Club Race will earn points towards the 2020 944 Cup East Racing Series and the 2020 PCA National Championship Points Series.\n\nTire support:\nTrackside Tire www.Tracksidetire.com 612 309-3165 Order well in advance to ensure availability.\n\nNo registered vehicle may exceed 102 dbA.\n\n3-day solo D